def duplicate_count(text):
    text=text.upper()
    res=0
    for symbol in range(65,91):
        if text.count(chr(symbol))>1:
            res+=1
    for symbol in range(48,58):
        if text.count(chr(symbol)) > 1:
            res += 1
    return res


